import { Gesture } from './gesture';
import { Pan } from './pan';
import { Press } from './press';
import { Swipe } from './swipe';
import { Tap } from './tap';
var MAP = {
    Pan: Pan,
    Press: Press,
    Swipe: Swipe,
    Tap: Tap,
};
export var getGesture = function (g) { return MAP[g]; };
export { Gesture };
